import { Button } from '../atoms/button';

export class Numpad extends React.Component {
    constructor(props) {
        super(props)
        this.passedFunction = this.passedFunction.bind(this)
    }
    passedFunction() { console.log(this.value); }
    handleClick = () => {
        console.log('clicked');
    }

    render() {
        return (
            <div className="flex flex-wrap -mx-2 overflow-hidden sm:-mx-2 md:-mx-2 lg:-mx-2 xl:-mx-2">
                <Button value={1} passedFunction={this.passedFunction} />
                <Button value={2} passedFunction={this.passedFunction} />
                <Button value={3} passedFunction={this.passedFunction} />
                <Button value={4} passedFunction={this.passedFunction} />
                <Button value={5} passedFunction={this.passedFunction} />
                <Button value={6} passedFunction={this.passedFunction} />
                <Button value={7} passedFunction={this.passedFunction} />
                <Button value={8} passedFunction={this.passedFunction} />
                <Button value={9} passedFunction={this.passedFunction} />
                <Button value={0} passedFunction={this.passedFunction} />
                <div className="my-2 px-2 w-2/3 overflow-hidden sm:my-2 sm:px-2 sm:w-2/3 md:my-2 md:px-2 md:w-2/3 lg:my-2 lg:px-2 lg:w-2/3 xl:my-2 xl:px-2 xl:w-2/3">
                    <button className="bg-blue-500 hover:bg-blue-700 text-white font-bold py-2 px-4 rounded">Calculate!</button>
                </div>
            </div>

        );
    }


}
